import React from "react";
import Layout from "../components/Layout";
import Container from '@mui/material/Container';


const Blog = () => {
  return (
    <>
      <Layout title={"PhoenixTech-Blog"}>
        <Container maxWidth="sm"></Container>
      </Layout>
    </>
  );
};

export default Blog;
